  <div class="cf">
    <div class="fl w-100 mb6-ns mb2">
      <h2 class="f2 normal tc-ns">Monica empowers people who want to be better</h2>
      <p class="measure lh-copy center-ns">Monica is for people who have jobs, a family, and are busy trying to find a good work/life balance. So busy, that they dont have time anymore to remember to call a friend, say happy birthday to a nephew, or remember to invite someone special for dinner next week. The older we get, the more life gets in the way. Its sad, but its the reality.</p>
      <p class="measure lh-copy center">I created Monica to help these people.</p>
      <p class="measure lh-copy center">Monica is not a social network. It will never be. It's a private place for your eyes only, that you own, without any ads or malicious software that will read your data, where you can safely document what you know about who you love. And if you want another level of security, you can always <a href="https://github.com/monicahq/monica#get-started">install Monica</a> on a server that you own, for free.</p>
    </div>
    <div class="fl w-50-ns w-100 mb6-ns mb2 pl6-ns">
      <h3>Built for people. With people.</h3>
      <p class="measure lh-copy">Monica is open source. That means the code is <a href="https://github.com/monicahq/monica">publicly available</a>, scrutinized by thousands. Dozens of people have already contributed to the project. That level of transparency ensures both the security of the application, and your peace of mind concerning what we do with your data (nothing, in fact).</p>
    </div>
